import logo from './logo.svg';
import './App.css';
import Diagnose from './Diagnose';

import {Route, Link} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Diagnose />
      <Route exact path ="/" component={Diagnose} />

    </div>
  );
}

export default App;
